import React, { useState } from 'react';
import  app   from "../../utils/FirebaseConfig";
import { AuthContext } from "../../utils/Auth";
import { Redirect } from 'react-router';
import { useContext } from 'react';
import { Button, Nav } from 'react-bootstrap';

const LandingPage = ({history}) => {
  const [activeKey, setActiveKey] = useState("/home");
  const {currentUser} = useContext(AuthContext);
  debugger
  if (typeof currentUser ==='undefined') {
    return <Redirect to="/shopping_page" />;
  }


  return (
    <>
      <Nav
        activeKey="/home"
        onSelect={(selectedKey) => alert(`selected ${selectedKey}`)} >
        <Nav.Item>
          <Nav.Link href="/home">Active</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link onClick={()=>activeKey="/ink-1"} eventKey="link-1">Link</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link onClick={()=>activeKey="/ink-2"}  eventKey="link-2">Link</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link onClick={()=>activeKey="/disabled"}  eventKey="disabled" disabled>
            Disabled
          </Nav.Link>
        </Nav.Item>
      </Nav>

      <Button onClick={() => app.auth().signOut()}>Sign out</Button>
    </>
  );
};

export default LandingPage;
